    private EWMASagesDetector detector;

    //
    @Override
    protected void setUp() throws Exception {
        detector = new EWMASagesDetector();
    }

    //
    @Override
    protected void tearDown() throws Exception {
        detector = null;
    }

    //
    public void testEWMADetector() {
        double data[], dataReal[];
        TemporalDetectorDataInterface tddo = new TemporalDetectorSimpleDataObject();
        SimpleDateFormat inputDateFormat = new SimpleDateFormat("M/d/yyyy");
        Date startDate = null;
        try {
            startDate = inputDateFormat.parse("1/10/2007");
        } catch (ParseException e) {
            e.printStackTrace();
        }
//
        System.out.println("Testing EWMA detector");
        data = vec1;
        dataReal = v1;
        tddo.setCounts(data);
        tddo.setStartDate(startDate);
        detector.testDetector(tddo);
        for (int i = 0; i < tddo.getLevels().length; i++) {
            assertEquals(dataReal[i], tddo.getLevels()[i], .03);
        }
        data = vec2;
        dataReal = v2;
        tddo.setCounts(data);
        tddo.setStartDate(startDate);
        detector.testDetector(tddo);
        for (int i = 0; i < tddo.getLevels().length; i++) {
            assertEquals(dataReal[i], tddo.getLevels()[i], .03);
        }
        data = vec3;
        dataReal = v3;
        tddo.setCounts(data);
        tddo.setStartDate(startDate);
        detector.testDetector(tddo);
        for (int i = 0; i < tddo.getLevels().length; i++) {
            assertEquals(dataReal[i], tddo.getLevels()[i], .03);
        }
    }
